import * as moment from 'moment';
import jsPDF from 'jspdf';
import { Injectable } from '@angular/core';
import { Repair, RepairLegacy } from '@app/_models';
import { ToastrService } from 'ngx-toastr';
import { Customer } from '@app/_models/customer';

@Injectable({
    providedIn: 'root',
})
export class RepairVoucherGeneratorService {
    constructor(private toastrService: ToastrService) {}

    // FIXME: Implement this method - Add missing fonts. Check for date formatting and handling.
    // FIXME: Refactor and relocate image usages
    public print(canGenerateReport: boolean, customer: Customer, repair: Repair) {
        if (canGenerateReport) {
            // Default export is a4 paper, portrait, using milimeters for units

            const brillanteLogo =
                'data:image/png;base64,';

            const imagenFirma =
                'data:image/png;base64,';

            const doc = new jsPDF();

            //const generationDate = Utils.processDate(new Date(), true);

            const horizontalMargin = 15;

            const verticalMargin = 10;

            let lastLine = 0;

            doc.addFileToVFS(
                'Bariol-Regular.ttf',
                ''
            );
            doc.addFont('Bariol-Regular.ttf', 'BariolRegular', 'normal');

            doc.setFont('BariolRegular');

            doc.addImage(brillanteLogo, 'JPEG', horizontalMargin, verticalMargin, 65, 18);

            doc.setFontSize(12);

            doc.setTextColor(90);

            lastLine += 20;

            doc.text('25 de Mayo 3567 - Santa Fe, Capital', 136, lastLine);

            lastLine += 4;

            doc.text('www.brillantestore.com', 159, lastLine);

            lastLine += 4;

            doc.text('contacto@brillantestore.com', 150, lastLine);

            doc.setTextColor(0);

            doc.setFontSize(22);

            lastLine += 20;

            doc.text('SERVICIO TÉCNICO', 15, lastLine);

            moment.locale('es'); //Colocamos fechas para que vayan con el formato espaÃ±ol, identificando los dÃ­as

            const fechaActual = moment(new Date());

            const fechaIngreso = repair.checkIn;

            doc.setFontSize(14);

            doc.text(
                this.capitalize(fechaActual.format('dddd')) +
                    ' ' +
                    fechaActual.format('DD') +
                    ' de ' +
                    this.capitalize(fechaIngreso.format('MMMM')) +
                    ' de ' +
                    fechaActual.format('YYYY'),
                130,
                lastLine - 1
            );

            // SecciÃ³n de datos del Cliente (Nombre completo, DNI, eMail, DirecciÃ³n, TelÃ©fono)

            lastLine += 20;

            doc.setFontSize(18);

            doc.text('Información del cliente:', 15, lastLine);

            lastLine += 1;

            doc.setLineWidth(0.5);

            doc.line(15, lastLine, 73, lastLine);

            doc.setFontSize(13);

            lastLine += 15;

            doc.text('Nombre y apellido:  ' + customer.firstName + ' ' + customer.lastName, 15, lastLine);

            lastLine += 10;

            doc.text('DNI: ' + customer.dni, 15, lastLine);

            lastLine += 10;

            doc.text('Dirección:  ' + customer.address, 15, lastLine);

            lastLine += 10;

            doc.text('Teléfono:  ' + customer.telephone, 15, lastLine);

            // SecciÃ³n de datos del equipo (Marca, equipo, IMEI, problema original)

            lastLine += 20;

            doc.setFontSize(18);

            doc.text('Información del equipo:  ', 15, lastLine);

            lastLine += 1;

            doc.setLineWidth(0.5);

            doc.line(15, lastLine, 73, lastLine);

            doc.setFontSize(13);

            lastLine += 15;

            doc.text('Modelo:  ' + repair.device.manufacturer + ' ' + repair.device.model, 15, lastLine);

            if (repair.device.deviceId) {
                lastLine += 10;
                doc.text('IMEI:  ' + repair.device.deviceId, 15, lastLine);
            }

            lastLine += 10;

            const notaReparacionLineas = doc.splitTextToSize('Reparación Realizada:  ' + repair.note, 185);

            for (const line of notaReparacionLineas) {
                lastLine += 5;

                doc.text(line, 15, lastLine);
            }

            // SecciÃ³n de datos de la reparaciÃ³n

            doc.setFontSize(13);

            lastLine += 15;

            doc.text('Fecha de ingreso:  ' + fechaIngreso.format('DD/MM/YYYY - HH:mm'), 15, lastLine);

            lastLine += 10;

            doc.text('Fecha de entrega:  ' + fechaActual.format('DD/MM/YYYY - HH:mm'), 15, lastLine);

            lastLine += 10;

            //doc.text('Garantía: ' + '30 días', 15, lastLine);
            if (repair.warrantyTerm > 0) {
                doc.text('Garantía: ' + repair.warrantyTerm + ' meses desde el día de la entrega del equipo reparado.', 15, lastLine);
            } else {
                doc.text('Garantía: LA PRESENTE REPARACIÓN NO CUENTA CON UN PERÍODO DE GARANTÍA.', 15, lastLine);
            }

            doc.setFontSize(12);

            doc.setTextColor(90);

            lastLine = 245;

            doc.addImage(imagenFirma, 'JPEG', horizontalMargin, lastLine, 180, 40);

            doc.save('Comprobante_Reparacion_' + repair.id + '.pdf');
        } else {
            this.toastrService.info(
                'Faltan datos necesarios para poder crear el comprobante. Chequee el haber guardado previamente el estado actual de la reparación. Revise que la reparación tenga estado "Listo para Entregar", "Pagado y Entregado" o "Saldo Pendiente", que las notas de la reparación no sean vacías y que además el precio de la reparación sea distinto de cero.'
            );
        }
    }
    //FIXME: Refactor and move this generic function elsewhere
    private capitalize = (s) => {
        if (typeof s !== 'string') return '';
        return s.charAt(0).toUpperCase() + s.slice(1);
    };
}
